    false,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from then               U.S. Census Bureau's Master Address File / Topologically
    Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The
    MTDB representsn               a seamless national file with no overlaps or gaps
    between parts, however, each TIGER/Line shapefile is designed to stand alone as
    an independent data set,n               or they can be combined to cover the entire
    nation. After each decennial census, the Census Bureau delineates Public Use Microdata
    Areas (PUMAs) for then               tabulation and dissemination of decennial census
    Public Use Microdata Sample (PUMS) data, American Community Survey (ACS) PUMS data,
    and ACS periodn               estimates. Nesting within states, or equivalent entities,
    PUMAs cover the entirety of the United States, Puerto Rico, Guam, and the U.S. Virgin
    Islands.n               PUMA delineations are subject to population, building block
    geography, geographic nesting, and contiguity criteria. Each PUMA is identified
    by an               5-character numeric census code that may contain leading zeros
    and a descriptive name. ",nt"license_title": null,nt"extras": [{ntt"key":
